import React, {useEffect, useState} from "react";
import Axios from "axios";
// const res = await Axios.get("https://newsapi.org/v2/top-headlines?country=us&category=entertainment&apiKey=c11c00d2a4f64b9381d31569344bb3fa");
const NewsList = () =>{
    const [articles, setArticles] = useState([]);

   useEffect(() => {
       const getArticles = async () => {
           const res = await Axios.get(
               "https://newsapi.org/v2/top-headlines?country=us&category=entertainment&apiKey=c11c00d2a4f64b9381d31569344bb3fa"
           );
           setArticles(res.data.articles)
           console.log(res);
       };
       getArticles().then(res => console.log(res)).catch(err => console.error(err));
   });
    return (
        <div>

        </div>
    )
}

export default NewsList;

